	(8, 'Wachowskis', 'The', '1965-06-21', 'Autre', 'wachowski.jpg', 'Lana Wachowski et Lilly Wachowski sont deux réalisatrices, scénaristes et productrices américaines, travaillant généralement ensemble. Leur duo est désigné sous l’appellation « les Wachowski » (en anglais « The Wachowskis » [ð? w??t?a?skiz]1).', 12),
