	(14, 'Braga', 'Sonia', '1950-06-08', 'F', 'braga.jpg', 'Issue d\'une famille d\'artistes, Sônia Maria Campos Braga débute sur scène à la fin des années 1960 dans la comédie musicale Hair. Parallèlement elle débute à la télévision et dès 1970 accède à un premier rôle au cinéma dans A Moreninha. C\'est pourtant le petit écran qui lui offre son premier succès — dans l\'adaptation brésilienne de Rue Sésame — en 1972. Au cinéma, elle continue sur sa lancée dans Mestica a Escrava Indomável et dans O Casal. C\'est encore la télévision qui la consacre star en 1975 grâce à la telenovela Gabriela (fondée sur le livre Gabriela, Cravo e Canela de Jorge Amado) dont elle interprète l\'héroïne. Par la suite elle s\'impose progressivement comme une des grandes stars d\'Amérique latine.', 20),
