	(17, 'DiCaprio', 'Leonardo', '1974-11-11', 'M', 'leo.jpg', 'Leonardo Wilhelm DiCaprio naît le 11 novembre 1974 à Los Angeles, en Californie. Il est le fils unique d\'un couple de hippies2. Son père George Paul DiCaprio (né en 1943) est un dessinateur et éditeur de bandes dessinées satiriques, d\'ascendance italienne (originaire d\'Alife dans la province de Caserte en Campanie) et allemande (originaire de Bavière), et sa mère Irmelin Indenbirken (née en 1943) est une secrétaire juridique d\'ascendance germano-russe originaire d\'Oer-Erkenschwick2 en Allemagne, dont la famille a émigré aux États-Unis dans les années 1950. Les parents divorcent en 19753.', 15),
